import React, {useState} from "react";
import logo from "../../sourse/images/new_лого.png";
import icon1 from "./svg/img.png"
import icon2 from "./svg/img_1.png"
import icon3 from "./svg/img_2.png"
import style from "./Header.module.css"
import "https://unpkg.com/ionicons@7.1.0/dist/ionicons/ionicons.esm.js";
import "https://unpkg.com/ionicons@7.1.0/dist/ionicons/ionicons.js";
import { SIGNIN_ROUTE } from "../../utils/consts";
import { Link, u } from "react-router-dom";

const Header = () => {
    const [isAuth, setIsAuth] = useState(false);

    const toggleIsAuth = () => {
        setIsAuth(!isAuth)
    }
    return (
        <header className={style.header}>
            <div className={style.header__logo}>
                <svg  width="38" height="35" viewBox="0 0 38 35" fill="none" xmlns="http://www.w3.org/2000/svg" xlink="http://www.w3.org/1999/xlink">
                    <rect width="38" height="35" fill="url(#pattern0)"/>
                    <defs>
                        <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
                            <use href="#image0_118_1386" transform="matrix(0.00195312 0 0 0.00212054 0 -0.0428571)"/>
                        </pattern>
                        <image id="image0_118_1386" width="512" height="512" href="data:image/png;base64,"/>
                    </defs>
                </svg>
                <img src={logo} alt="logotype"/>
                <span>InLife</span>
            </div>
            <nav className={style.header__navigation}>
                    <a href="#">Аренда</a>
                    <a href="#">Покупка</a>
                    <a href="#">Дома и участки</a>
                    <a href="#">Сервисы</a>
                </nav>
            <div className={style.header__logIn}>
                <div className={style.icons}>
                    <img src={icon1} alt="icon1" style={{width:'20px'}}/>
                    <img src={icon2} alt="icon2" style={{width:'30px'}}/>
                    <img src={icon3} alt="icon3" style={{width:'20px'}}/>
                </div>
                <button className={style.btn1}>+Разместить объявление</button>
                <Link to={SIGNIN_ROUTE}>
                    <button className={style.btn} onClick={toggleIsAuth}>Войти</button>
                </Link>
            </div>
        </header>
    );
};

export default Header;
